import './App.css';
import ReactApexChart from 'react-apexcharts'
import { useState } from 'react';

function App() {

  const [type1, settype1] = useState('pie')

  let series= [{
    name: 'Net Profit',
    data: [44, 55, 57, 56, 61, 58, 63, 60, 66]
  }]
  let options= {
  chart: {
    height: 350,
    zoom: {
      enabled: false
    }
  },
  dataLabels: {
    enabled: false
  },
  stroke: {
    curve: 'straight'
  },
  title: {
    text: 'Product Trends by Month',
    align: 'left'
  },
  grid: {
    row: {
      colors: ['#f3f3f3', 'transparent'], // takes an array which will be repeated on columns
      opacity: 0.5
    },
  },
  xaxis: {
    categories: ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun', 'Jul', 'Aug', 'Sep'],
  }
}




  return (
    <div className="App">
        <div className="app_body">
          <div className="buttons">
            <div className="bar">
                <button>Bar</button>
            </div>
            <div className="pie">
                <button>Pie</button>
            </div>
            <div className="donut">
                <button>Donut</button>
            </div>
            <div className="line">
                <button>Line</button>
            </div>
            <div className="dots">
                <button>Dots</button>
            </div>
          </div>
          <div className="chart">
          <ReactApexChart options={options} series={series} type={type1} height={350} />          </div>
        </div>
    </div>
  );
}

export default App;
